import React from 'react';

const Skills = () => {
  const skillCategories = [
    {
      title: "Frontend Development",
      skills: [
        { name: "HTML5", icon: "devicon-html5-plain-wordmark colored", level: 95 },
        { name: "CSS3", icon: "devicon-css3-plain-wordmark colored", level: 90 },
        { name: "JavaScript", icon: "devicon-javascript-plain colored", level: 88 },
        { name: "React", icon: "devicon-react-original colored", level: 92 },
        { name: "Bootstrap", icon: "devicon-bootstrap-plain colored", level: 85 },
        { name: "Tailwind CSS", icon: "devicon-tailwindcss-plain colored", level: 90 }
      ]
    },
    {
      title: "Backend & Frameworks",
      skills: [
        { name: "Python", icon: "devicon-python-plain colored", level: 95 },
        { name: "Django", icon: "devicon-django-plain colored", level: 94 },
        { name: "Java", icon: "devicon-java-plain colored", level: 82 },
        { name: "Spring", icon: "devicon-spring-plain colored", level: 80 },
        { name: "PHP", icon: "devicon-php-plain colored", level: 78 },
        { name: "Laravel", icon: "devicon-laravel-plain colored", level: 75 }
      ]
    },
    {
      title: "Databases & Storage",
      skills: [
        { name: "PostgreSQL", icon: "devicon-postgresql-plain colored", level: 90 },
        { name: "MySQL", icon: "devicon-mysql-plain-wordmark colored", level: 88 },
        { name: "MongoDB", icon: "devicon-mongodb-plain colored", level: 75 },
        { name: "Redis", icon: "devicon-redis-plain colored", level: 70 },
        { name: "Oracle", icon: "devicon-oracle-original colored", level: 65 },
        { name: "SQLite", icon: "devicon-sqlite-plain colored", level: 85 }
      ]
    },
    {
      title: "DevOps & Cloud",
      skills: [
        { name: "Docker", icon: "devicon-docker-plain colored", level: 85 },
        { name: "Kubernetes", icon: "devicon-kubernetes-plain colored", level: 75 },
        { name: "AWS", icon: "devicon-amazonwebservices-plain-wordmark colored", level: 80 },
        { name: "Linux", icon: "devicon-linux-plain colored", level: 88 },
        { name: "Nginx", icon: "devicon-nginx-original colored", level: 78 },
        { name: "Apache", icon: "devicon-apache-plain-wordmark colored", level: 82 }
      ]
    },
    {
      title: "Tools & Version Control",
      skills: [
        { name: "Git", icon: "devicon-git-plain colored", level: 92 },
        { name: "GitHub", icon: "devicon-github-original colored", level: 90 },
        { name: "GitLab", icon: "devicon-gitlab-plain colored", level: 85 },
        { name: "VS Code", icon: "devicon-vscode-plain colored", level: 95 },
        { name: "Jira", icon: "devicon-jira-plain colored", level: 80 },
        { name: "Jenkins", icon: "devicon-jenkins-plain colored", level: 72 }
      ]
    },
    {
      title: "Data & Analytics",
      skills: [
        { name: "Pandas", icon: "devicon-pandas-original colored", level: 85 },
        { name: "NumPy", icon: "devicon-numpy-original colored", level: 80 },
        { name: "TensorFlow", icon: "devicon-tensorflow-original colored", level: 70 },
        { name: "Tableau", icon: "devicon-tableau-plain colored", level: 65 },
        { name: "PowerBI", icon: "devicon-powerbi-plain colored", level: 60 },
        { name: "Jupyter", icon: "devicon-jupyter-plain colored", level: 82 }
      ]
    }
  ];

  return (
    <section id="skills" className="px-4 sm:px-6 md:px-12 lg:px-24 py-12 md:py-20 bg-tech-blue text-white">
      <div className="max-w-7xl mx-auto">
        {/* Header */}
        <div className="text-center mb-12 md:mb-16">
          <h2 className="text-3xl sm:text-4xl md:text-5xl font-bold mb-4">
            Technical <span className="gradient-text">Expertise</span>
          </h2>
          <div className="w-20 h-1 bg-gradient-to-r from-tech-cyan to-tech-green mx-auto mb-6"></div>
          <p className="text-lg text-tech-light/70 max-w-3xl mx-auto">
            Full-stack proficiency with modern technologies and cloud architecture
          </p>
        </div>

        {/* Skills Grid */}
        <div className="grid md:grid-cols-2 lg:grid-cols-3 gap-6 md:gap-8">
          {skillCategories.map((category, catIndex) => (
            <div 
              key={catIndex}
              className="bg-tech-navy/50 backdrop-blur-sm rounded-2xl p-6 border border-tech-cyan/20 hover:border-tech-cyan/40 transition-all duration-300 hover:shadow-2xl hover:shadow-tech-cyan/10"
            >
              <h3 className="text-xl font-bold mb-6 text-tech-cyan text-center flex items-center justify-center gap-2">
                <span className="text-tech-cyan">‚öôÔ∏è</span>
                {category.title}
              </h3>

              <div className="space-y-4">
                {category.skills.map((skill, skillIndex) => (
                  <div 
                    key={skillIndex}
                    className="flex items-center gap-4 p-3 rounded-lg hover:bg-tech-blue/30 transition-all duration-300 group"
                  >
                    {/* Icon Container */}
                    <div className="flex-shrink-0 w-14 h-14 flex items-center justify-center bg-tech-blue/20 rounded-xl group-hover:bg-tech-blue/40 transition-colors">
                      <i className={`${skill.icon} text-3xl md:text-4xl`}></i>
                    </div>

                    {/* Skill Info */}
                    <div className="flex-grow">
                      <div className="flex justify-between mb-1">
                        <span className="font-medium text-tech-light group-hover:text-tech-cyan transition-colors">
                          {skill.name}
                        </span>
                        <span className="text-tech-cyan font-bold text-sm">
                          {skill.level}%
                        </span>
                      </div>

                      {/* Progress Bar */}
                      <div className="h-2 bg-tech-blue/30 rounded-full overflow-hidden">
                        <div 
                          className="h-full bg-gradient-to-r from-tech-cyan to-tech-green rounded-full transition-all duration-1000"
                          style={{ width: `${skill.level}%` }}
                        ></div>
                      </div>
                    </div>
                  </div>
                ))}
              </div>
            </div>
          ))}
        </div>

        {/* Additional Skills Row */}
        <div className="mt-12 md:mt-16 bg-tech-navy/30 rounded-2xl p-6 md:p-8 border border-tech-cyan/10">
          <h3 className="text-2xl font-bold mb-6 text-tech-cyan text-center">
            Additional Technologies & Tools
          </h3>

          <div className="grid grid-cols-2 sm:grid-cols-3 md:grid-cols-4 lg:grid-cols-6 gap-4">
            {[
              { name: "TypeScript", icon: "devicon-typescript-plain colored" },
              { name: "GraphQL", icon: "devicon-graphql-plain colored" },
              { name: "Next.js", icon: "devicon-nextjs-plain colored" },
              { name: "Vue.js", icon: "devicon-vuejs-plain colored" },
              { name: "Sass", icon: "devicon-sass-original colored" },
              { name: "WordPress", icon: "devicon-wordpress-plain colored" },
              { name: "Firebase", icon: "devicon-firebase-plain colored" },
              { name: "Heroku", icon: "devicon-heroku-plain colored" },
              { name: "DigitalOcean", icon: "devicon-digitalocean-plain colored" },
              { name: "Ansible", icon: "devicon-ansible-plain colored" },
              { name: "Terraform", icon: "devicon-terraform-plain colored" },
              { name: "Prometheus", icon: "devicon-prometheus-original colored" }
            ].map((tech, index) => (
              <div 
                key={index}
                className="flex flex-col items-center p-4 bg-tech-blue/20 rounded-xl hover:bg-tech-blue/40 transition-all duration-300 group"
              >
                <i className={`${tech.icon} text-3xl mb-2`}></i>
